5 01:49:00','17292FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(17293,162555,'A convenience set of reactions to allergens for documenting allergy history','en',1,'2014-08-05 19:29:21',1,'2015-06-12 02:09:51','17293FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(17294,162554,'A convenience set to allow for easy selection of common environmental allergens','en',1,'2014-08-05 19:29:49',1,'2015-06-12 02:09:36','17294FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(17295,162553,'A convenience set to allow for easy selection of common food allergens','en',1,'2014-08-05 19:30:02',1,'2015-06-12 02:09:19','17295FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(17296,162552,'A convenience set to allow for easy selection of common drug allergens','en',1,'2014-08-05 19:30:18',1,'2015-06-12 02:09:04','17296FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(17312,162582,'A qualifier term which can be used to differentiate a numeric entry. For example, a duration could be a number + duration unit (number of occurrences).','en',1,'2014-09-17 21:42:59',1,NULL,'17312FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(17313,162583,'Unit of time, 1/60 of a minute','en',1,'2014-09-18 15:14:53',1,'2016-01-27 01:41:48','17313FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(17401,162820,'A question which identifies the severity of a problem or diagnosis. Also can be used as a convenience set.','en',1,'2015-01-06 22:32:02',1,'2015-01-23 02:45:55','17401FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(17404,160241,'Administration within the respiratory tract by inhaling orally or nasally for local or systemic effect.','en',1,'2015-01-16 19:49:57',1,NULL,'17404FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(17405,160245,'Administration beneath the skin; hypodermic.  ','en',1,'2015-01-16 19:50:39',1,NULL,'17405FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(17406,160243,'Administration within a muscle.','en',1,'2015-01-16 19:51:06',1,NULL,'17406FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(17407,160240,'Administration to or by way of the mouth.','en',1,'2015-01-16 19:51:31',1,NULL,'17407FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(17408,160242,'Administration within or into a vein or veins.','en',1,'2015-01-16 19:51:57',1,NULL,'17408FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(17409,161253,'Administration to the nose; administered by way of the nose.','en',1,'2015-01-16 19:53:14',1,NULL,'17409FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(17410,162391,'Administration through the dermal layer of the skin to the systemic circulation by diffusion.','en',1,'2015-01-16 19:54:41',1,NULL,'17410FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(17411,162392,'Administration into the vagina.','en',1,'2015-01-16 19:55:29',1,NULL,'17411FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(17412,162393,'Administration to the rectum.','en',1,'2015-01-16 19:56:07',1,NULL,'17412FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(17413,162798,'Administration through the nose and into the stomach, usually by means of a tube.','en',1,'2015-01-16 19:56:53',1,NULL,'17413FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(17414,162879,'Drugs used for chemotherapy treatment; multiple drugs are allowed.','en',1,'2015-06-01 17:20:38',NULL,NULL,'c22bb82f-b4f6-47bc-8fbb-380a5e340bb5'),(17415,162887,'A coded value of Race','en',1,'2015-06-01 17:28:36',NULL,NULL,'5010ea68-0d70-499d-856c-20fafca61ff0'),(17416,162888,'A coded value of Race','en',1,'2015-06-01 17:29:00',NULL,NULL,'e31a54a2-b88d-49ae-b7a6-fceca761ad25'),(17417,162889,'A coded value of Race','en',1,'2015-06-01 17:29:21',NULL,NULL,'a024e7e7-736f-416e-b64c-a39a6b777bd5'),(17418,162890,'A coded value of Race','en',1,'2015-06-01 17:29:50',NULL,NULL,'84f13315-c8c6-4140-8278-f81ac9004636'),(17419,162891,'A coded value of Race','en',1,'2015-06-01 17:30:15',NULL,NULL,'9807f41e-a029-465e-9ad6-7318c4f8a54d'),(17420,162892,'A coded value of education level','en',1,'2015-06-01 17:31:23',NULL,NULL,'58f1b400-d123-41ad-80b5-604a0a0ddbeb'),(17421,162893,'A coded value of education level','en',1,'2015-06-01 17:31:47',NULL,NULL,'2e364085-ef57-4df5-b4f4-ce2f7486f602'),(17422,162894,'A coded value of education level','en',1,'2015-06-01 17:32:12',NULL,NULL,'3dd87be4-09b6-4cfa-bf22-664477dac4e3'),(17423,162895,'A coded value of education level','en',1,'2015-06-01 17:32:30',NULL,NULL,'77bd2240-e7f7-4028-8fb6-155590ae1e58'),(17424,162896,'A coded value of education level','en',1,'2015-06-01 17:33:05',NULL,NULL,'67a84f0a-e835-47ef-9aa6-a6bdd356d5bc'),(17425,162897,'A coded value of education level','en',1,'2015-06-01 17:33:32',NULL,NULL,'2792f1e3-98e3-4466-aa20-835acb8e53c0'),(17426,162898,'The race of a person','en',1,'2015-06-01 17:34:41',NULL,NULL,'2f12c9b6-b035-4b30-928a-277f089f72db'),(17427,162899,'Highest education level of a person','en',1,'2015-06-01 17:36:04',NULL,NULL,'f37bbb45-80ac-4630-b9f8-f378aad2bb9f'),(17428,162901,'Cancer followup care','en',1,'2015-06-01 17:37:02',NULL,NULL,'b3db31a8-a482-4a46-9304-179a90c1f431'),(17429,162900,'Cancer followup care','en',1,'2015-06-01 17:37:09',NULL,NULL,'426851a7-92f3-4b66-bf59-406e25c9c9bd'),(17430,162902,'Cancer followup care','en',1,'2015-06-01 17:37:32',NULL,NULL,'e08896b1-4f42-4664-bf62-46051d5e40da'),(17431,162903,'Cancer followup care','en',1,'2015-06-01 17:37:57',NULL,NULL,'24a0aa34-1af7-44d2-9ad2-c7d68d9335d9'),(17432,162904,'Cancer followup care','en',1,'2015-06-01 17:38:22',NULL,NULL,'3e10c02b-05dd-48c7-8e81-c8ee2a46da0b'),(17433,162905,'Cancer followup care','en',1,'2015-06-01 17:38:54',NULL,NULL,'bcc9daba-b98e-4256-a805-f563bf7ff7a5'),(17434,162906,'As a survivor, your chance of developing a second cancer is about twice that of a person of the same sex and age who has never had cancer. This may be a different type of cancer altogether, or a cancer in the same site as before, that is not related to the first cancer. While this sounds scary, it is important to be aware of this risk and be proactive in your own healthcare. It is not well understood why survivors have this risk, but having follow up care, cancer screening and a healthy lifestyle can decrease your risk. In some cases, a treatment (types of chemotherapy or radiation therapy) increases the risk of another cancer. These are called secondary cancers because they develop as a result of therapy. If you are at risk for a secondary cancer, it will be discussed further in your plan.<br><br>\r\n\r\nBecause of this risk, survivors are encouraged to adapt a healthy lifestyle of exercise, avoidance of tobacco use and alcohol only in moderation ( less than two drinks a day for men and one for women ), maintaining a healthy weight and eating a health conscious diet, including lots of fruits and vegetables. The American Institute for Cancer Research has developed nutrition guidelines for cancer survivors to address questions related to diet. Practice safe sun habits by using sunscreen, wearing protective clothing and not using tanning booths. Survivors should follow recommended guidelines for cancer screening, with earlier screening if they are in a high risk category (i.e. radiation to an area, genetic syndrome).','en',1,'2015-06-01 17:39:23',NULL,NULL,'9dbcd003-2980-4004-a917-ebe139ddd445'),(17435,162907,'Fatigue is the one of the most common side effects of cancer treatment.  Patients who have received chemotherapy or radiation treatment may be most likely to experience fatigue.  Pain, emotional distress, sleep problems, and other medical problems may also contribute to the experience of fatigue.<br><br>\r\n\r\nThis feeling of complete exhaustion can last for several months to years after treatment ends. Soon after treatment is complete, friends, family and co-workers often expect the survivor to be back to doing the things they did before treatment, with the same level of energy, although this may not be immediately possible.   Research has suggested that moderate exercise may reduce fatigue, along with emotional distress and sleep disturbance.','en',1,'2015-06-01 17:41:30',NULL,NULL,'eafd6036-e452-49a7-884b-fc386ef7e425'),(17436,162908,'Certain chemotherapy medications can cause damage to the blood cells in the bone marrow. This damage can cause leukemia or myelodysplasia (MDS) to develop years after therapy has been completed. Both diseases cause an abnormal production of poorly functioning blood cells, making it difficult for the body to fight infection, carry oxygen to the tissues and prevent bleeding.<br><br>\r\n\r\nLeukemia and MDS caused by chemotherapy or radiation therapy typically occurs between 4-10 years after treatment, but can occur even later. One exception is those caused by etoposide (VP-16) or teniposide (two types of chemotherapy), which generally occur within 1-3 years after therapy. Secondary lymphomas have also been seen in Hodgkin\'s disease survivors who received the MOPP (nitrogen mustard [mustargen], vincristine [oncovin], procarbazine, and prednisone) chemotherapy regimen.','en',1,'2015-06-01 17:42:46',NULL,NULL,'8f2362ed-e265-4fba-9714-6632f4900883'),(17437,162909,'Oxaliplatin is associated with a neuropathy, typically not affecting strength. Symptoms may include numbness, tingling, burning, or cold-induced pain.  This problem can result in trouble with fine motor skills, such as tying shoes, or walking.  In most patients, these symptoms resolve between weeks and months after stopping oxaliplatin.  Approximately 1 in 10 patients have mild persistent neuropathy for a longer duration after treatment, and about 1 in 100 may have severe neuropathy. If this side effect develops, then you should contact your physician to discuss medical treatment options.  Evaluation and management by a physical or occupation therapist should also be considered.','en',1,'2015-06-01 17:44:03',NULL,NULL,'75cacde5-89e9-415c-bec9-bb1e37960f91'),(17438,162910,'Mitomycin can cause pulmonary complications in patients receiving the drug, causing difficulties with breathing, but this happens while taking the medication. Although the initial injury occurs while on therapy, it can lead to chronic lung disease in a survivor.','en',1,'2015-06-01 17:44:35',NULL,NULL,'33c0f4b9-f54c-4108-bf9e-872f71dcd9f5'),(17439,162911,'Some chemotherapy agents will cause the skin to darken or lighten in spots or cause the nails to change color or fall off. While this typically happens while on therapy, these effects can become chronic. Good hygiene and skin care, including washing with a mild soap and water, hydrating lotions for dry or scaly skin, and protecting any open skin wounds can all aid in recovery from these toxicities.','en',1,'2015-06-01 17:45:12',NULL,NULL,'b703ef1a-b724-43b4-8b3b-35d8048c7c35'),(17440,162912,'Many survivors who have previously received or are currently undergoing chemotherapy report experiencing cognitive changes, often referred to as \"chemo-brain.\" These changes include difficulty with short term memory, multi-tasking, new learning, reading comprehension, working with numbers and a decrease in concentration ability. For many years this was attributed, by physicians and researchers, to depression or anxiety over the diagnosis and treatment of cancer. More recently, researchers have begun to study and document what survivors have been saying all long; cognitive changes after chemotherapy are real. Although we are not yet able to pinpoint whether only certain chemotherapies are responsible, it seems certain that the effects are cumulative. That is, those who receive more chemotherapy tend to experience greater deficits. Studies have found that cognitive ability can improve over time in some survivors, but deficits are still present in many long term survivors, years after treatment.<br><br>\r\n\r\nSome medications are being studied as potential treatments for cognitive changes, but there is not yet enough data to support their use. Some of the agents being studied include: methylphenidate (Ritalin), modafinil (a medication approved to treat narcolepsy), various antidepressants, herbal therapies, such as ginkgo biloba, ginseng and certain amino acids. Cognitive rehabilitation programs are structured programs utilizing exercise, tasks that use memory and puzzles to \"rehabilitate\" one\'s mind. These programs are typically used for people with brain injuries, but therapists have tailored programs for cancer survivors. Bookstores and websites offer memory training, which may be helpful to survivors. Puzzles using numbers, like Sodoku, may help \"exercise\" your brain. Fatigue can enhance cognitive problems, so avoiding fatigue by getting enough sleep, incorporating exercise into your life and eating a healthy diet may be helpful.','en',1,'2015-06-01 17:46:28',NULL,NULL,'358e24e7-9ac6-4643-bc22-ced21df9c0f4'),(17441,162913,'Osteoporosis and osteopenia (the precursor to osteoporosis) are decreases in bone density, which increases the risk of fracture of the affected bones. Long term use of corticosteroids (dexamethasone or prednisone, > 5mg per day for more than 2 months), receiving chemotherapy medications (including methotrexate, ifosfamide, cytoxan, fluorouracil and interferon alpha) or radiation to weight bearing bones (spine, hips, legs) all increase the risk of developing osteoporosis.<br><br>\r\n\r\nWomen who develop premature menopause, have their ovaries removed before menopause or those who take aromatase inhibitors (anastrozole, letrozole and exemestane) are at increased risk for osteoporosis. Men who receive hormone therapy for prostate cancer or undergo orchiectomy are at greater risk. In addition, patients who have undergone gastrectomy (removal of the stomach) are at increased risk to develop osteoporosis.<br><br>\r\n\r\nAs for lifestyle risks, smokers, people who consume excessive alcohol and those who do not participate in weight bearing exercise have an increased risk of developing osteoporosis. Therefore, it is very important that survivors not drink alcohol or smoke. In addition, survivors should engage in weight-bearing exercise such as walking, weight lifting, riding a stationary bicycle, jogging, dancing, and any exercise where the legs are supporting the body\'s weight. These efforts, combined with increasing calcium and vitamin D in your diet and taking calcium and vitamin D supplements, will greatly help to reduce your risk of developing osteoporosis.\r\n\r\nSurvivors at risk should have adequate intake of calcium (1200-1500mg total per day, taken in divided doses) and vitamin D (400-800 international units per day if under age 50, and 800-1000 international units per day if over age 50).   Calcium supplements are an easy way to get the recommended daily amount and come in 2 forms: calcium carbonate and calcium citrate. The body does have some trouble absorbing large amounts of calcium, so supplements should be split into 2 or more doses per day. Calcium carbonate requires stomach acid to be absorbed by the body, therefore people that take acid reducers (such as Zantac, Tagamet) and/or proton pump inhibitors (such as Prilosec, Prevacid, etc) should use calcium citrate. If you have trouble tolerating your calcium supplement, talk to your doctor or nurse; there may be another formulation you can tolerate more easily. It is important to take Vitamin D with the calcium supplements because it helps your body to absorb calcium better. Survivors should talk to their healthcare provider about screening with DEXA scan (a test used to assess bone density) and options for treatment, if necessary. <br><br>\r\n\r\nSummary:\r\n\r\n<ul>\r\n\r\n<li>Avoid smoking and excessive alcohol intake</li>\r\n\r\n<li>Perform weight bearing exercise 2-3 times per week</li>\r\n\r\n<li>Calcium intake of 1200-1500mg per day plus Vitamin D 400-800iu or 800-1000iu per day (either in dietary intake or supplements)</li>\r\n\r\n<li>Consider screening with DEXA scan</li>','en',1,'2015-06-01 17:47:22',NULL,NULL,'0d913b7a-f14a-45c8-84c0-cc96fe1b3ea2'),(17442,162914,'Women of any age may have sexuality concerns after cancer treatment. Issues may include vaginal dryness, painful intercourse, and reduced sexual desire.  Many of these issues can be caused by the start of menopause, which can occur with cancer treatment.  With the start of menopause, women may also experience hot flashes, mood swings, fatigue and irritability.  Women should not hesitate to raise these issues with their healthcare provider.  Evaluation by an endocrinologist may be considered for early menopause. <br><br>\r\n\r\nConcerns about changes in your body appearance and the emotional distress of cancer can also cause changes in your relationship with your partner and how you feel about your sexuality.  Communication with your partner is important. <br><br>\r\n\r\nAvailable treatment options for sexual problems in women depend upon the symptom.  For vaginal dryness or pain with intercourse, vaginal moisturizers or water or silicone-based lubricants during intercourse may be helpful.  Pelvic floor muscle training or vaginal dilators may be useful after radiation therapy to prevent vaginal narrowing.  Pain may be treated with medications.  Do not hesitate to contact your health care provider to help with these problems.','en',1,'2015-06-01 17:48:06',NULL,NULL,'c860ccda-9846-4b3c-a353-8f772171f5d3'),(17443,162915,'Resumption and preservation of fertility after cancer therapy is a very complex topic. It has not been very well studied, but is related to the doses and types of medications received, if radiation was also received, the age at time of treatment and, for women, the number of oocytes (eggs) present when therapy started. With all of these variables, there is no way to easily predict a survivor\'s reproductive health. In many studies, female survivorsâ€™ reproductive status was evaluated by the resumption of menses after therapy, but this is in no way a guarantee of fertility, making it difficult to interpret these results for women when discussing risk for infertility.<br><br>\r\n\r\nSurvivors who wish to become pregnant or evaluate their fertility should consider seeing a reproductive specialist who has experience working with cancer survivors. Testing may be performed to help evaluate fertility, including certain hormone levels and counting the number of developing follicles early in a womanâ€™s cycle (called an antral follicle count). Fertile Hope maintains a list of specialists and offers financial assistance to cancer survivors. While they can be of help to many survivors, the organizationâ€™s main goal is to help in preserving fertility prior to cancer therapy. For survivors who have already completed therapy, The National Infertility Associationâ€™s website, Resolve, offers information on fertility treatments and testing, adoption, and deciding to not have children. This site also offers information on individual state laws about fertility coverage by insurers. The American Society of Clinical Oncology (ASCO) suggests that women with a history of cancer and cancer treatment should be considered high risk for perinatal complications and would be a good idea to seek specialized perinatal care. <br><br>\r\n\r\nChemotherapy agents that are most strongly tied to infertility include: alkylating agents, cytarabine, vinca alkaloids, and bortezomib. Radiation fields that include the female pelvis or brain can also affect fertility. It is not well understood how many of the newer agents will affect long term fertility. Women who do resume menstruation after cancer therapy should be aware that they could still suffer earlier than expected menopause, which may be a consideration when planning a family. <br><br>\r\n\r\nOf equal importance is that cancer patients and survivors recognize that a gray zone exists after menstruation stops, when fertility may be possible. Even if a womanâ€™s periods stop during treatment, she may be able to get pregnant. For this reason, use of birth control during cancer treatment for any premenopausal patient is essential. Accidental pregnancy during cancer treatment can be difficult to cope with, as it may limit the treatments available. <br><br>\r\n\r\nSummary\r\n\r\n<ul>\r\n\r\n<li>Survivors wishing to become pregnant should consider consulting with a fertility specialist familiar with cancer survivors. </li>\r\n\r\n<li>Pregnant survivors should consider being followed by a high-risk obstetrician. </li>\r\n\r\n<li>Cancer patientâ€™s should be aware that getting pregnant may be possible even after menstruation has stopped. Because treatments such as chemotherapy and radiation may be dangerous to an unborn baby, all patients who were actively menstruating before beginning cancer treatment should use birth control during cancer treatment, even if periods have stopped.</li>\r\n\r\n</ul>','en',1,'2015-06-01 17:48:54',NULL,NULL,'92a21f78-f08f-4b13-b9f1-5a701456182b'),(17444,162916,'Sexuality concerns for male survivors can include decreased interest in sex and erectile dysfunction (ED).  Communication with your partner about sexual issues is important.<br><br>\r\n\r\nA number of therapies are available to address sexual problems in men. Testosterone replacement therapy may be effective in both increasing sexual desire and improving erectile function in men with low levels of serum testosterone. Medication for ED (for example, viagra) may be used to treat erectile dysfunction.  Men may also consider penile implants or pumps.  If you find that the experience of cancer has affected your sexuality, you should talk with your healthcare provider.  An evaluation by a urologist should be considered if medicines are not helpful.','en',1,'2015-06-01 17:49:32',NULL,NULL,'de5f1531-34bb-429c-993a-334de235d9fb'),(17445,162917,'There are many medications of which we do not know the long term effects. Because of the combination of multiple drugs for most cancer treatments, it is sometimes difficult to be certain which medication is the cause of a long term effect. Research is continuing and new information may become available. You should periodically talk to your healthcare team about new information or look for new information in reliable journals and/or internet sites. <br><br>\r\n\r\nIn addition, there have been many new therapies in the last ten years, including many of the biologic therapies, monoclonal antibodies and targeted therapies. We may not know the long term effects of these medications for many years. As a survivor, you should be an active participant in your healthcare and keep an ear out for new information.','en',1,'2015-06-01 17:50:16',NULL,NULL,'a46a8532-0f1a-4013-9eb3-16bfd1cf9585'),(17446,162918,'During surgery, some patients undergo a diversion of the bowel in the form of a temporary or permanent ostomy.  An ostomy has many possible effects on daily life, including wearing an ostomy bag underneath oneâ€™s clothing, possible skin irritation, challenges with diet selection and bowel control.  Social, emotional, or sexual issues may also arise.  Colorectal cancer survivors with an ostomy are advised to empty and seal their pouch before engaging in sexual activity.   At some point, survivors with an ostomy should see an ostomy nurse, who can provide help and education in caring for the ostomy and its associated appliances.','en',1,'2015-06-01 17:51:25',NULL,NULL,'680cbc52-9395-41c6-92c9-cf63725d46dd'),(17447,162919,'The removal of lymph nodes from the axilla (underarm), abdomen, or groin area can lead to decreased drainage in the closest limb, causing lymphedema (a swelling of the limb) to result. In the case of head and neck cancers, the swelling can involve the neck and face. Survivors who have also received radiation therapy to the area are at greater risk of developing lymphedema, which can occur years after therapy. While sentinel node biopsy can decrease the risk of developing subsequent lymphedema, the risk is not completely eliminated. Lymphedema can cause pain, disfigurement, functional limitations and increase the risk of a serious infection in that limb. A Certified Lymphedema Therapist should be consulted at the first sign of swelling to achieve the best outcomes. Survivors should be aware of this potential complication, given information on self-care and instructed to notify the healthcare team with any signs of swelling or infection. <br><br>\r\n\r\nSigns of lymphedema may include the following changes in the area near surgery (arm, leg, abdomen, genitals): full or heavy feeling, skin changes (reddened, warm, cool, dry, hard, stiff), aching/discomfort, tightness, or less movement/flexibility in nearby joints. You may also experience difficulty fitting into clothes like the sleeve of a jacket or pant leg, or feel your socks are too tight. In addition, you may notice jewelry feels tight even though you have not gained any weight. Lymphedema can occur right after surgery, weeks, months, or even years later. The possibility of developing lymphedema continues throughout a personâ€™s lifetime. Survivors should be vigilant in monitoring for early signs of swelling and practice prevention. If swelling develops, prompt, proper management and therapy allows for the best outcomes. <br><br>\r\n\r\nTo help prevent and control lymphedema, survivors should try to avoid infections, burns, cuts, excessive hot/cold or injury to the limb that is at risk. Avoid insect bites by using inset repellent. Use lotion to prevent dry, chapped skin. Use sunscreen with SPF 15 or higher and try to avoid the sun during the hottest time of day. Avoid pressure or constriction of the limb. Avoid tight fitting clothes and jewelry. <br><br>\r\n\r\nThose at risk for lymphedema can and should exercise. Start with low intensity exercise and gradually increase intensity while monitoring for changes in your limb including swelling or redness. If any swelling or redness occurs, stop the exercise and consult your physician. The person at risk for lymphedema should consider wearing a compression garment with vigorous or very strenuous exercise. <br><br>\r\n\r\nWhenever possible, have blood drawn, IVs placed, and shots/vaccinations given and blood pressure taken in the unaffected arm.  The National Lymphedema Network is also a great resource for information. <br><br>\r\n\r\nSurgery to remove the lymph nodes (or sentinel node/s) can result in injury to the nerves in that area. Nerve damage can cause pain, numbness, tingling, decreased sensation or strength in the area or limb. For instance, axillary (underarm) lymph node removal can result in these symptoms on the chest wall, under the arm (armpit) or in the arm and/or hand on the treated side. Injuries like this could be aggravated by scar tissue formation after radiation therapy to the area, which can develop years after therapy. This type of pain is called nerve pain and is treated with different medications than other types of pain. Survivors with this type of pain may benefit from a consult with a pain specialist.<br><br>\r\n\r\nSummary:\r\n\r\n<ul>\r\n\r\n<li>Report any signs of swelling in the at risk limb to your healthcare provider, and see a certified lymphedema therapist promptly if these symptoms develop.</li>\r\n\r\n<li>Practice preventive measures to decease the risk of developing or worsening lymphedema. </li>\r\n\r\n</ul>','en',1,'2015-06-01 17:52:00',NULL,NULL,'d9a5ef42-c178-4ead-b190-5ba1493373d0'),(17448,162920,'Modern surgical techniques have allowed many rectal and anal cancers to be resected without requiring a colostomy. While many have assumed this would lead to better quality of life for survivors, this has not proven to be true in studies. In many cases the survivor has traded the colostomy for a different set of challenges with their bowels. Survivors commonly report needing to move their bowels frequently and/or urgently, having loose bowels or incontinence, gas / bloating and being intolerant of certain foods. These problems can have a big affect on quality of life, but some planning may help. Start by keeping a food diary. Record what and when you eat, what side effects you experience, and when they occur in relation to meals. This may give you a clear idea of what foods you need to avoid, but can be very helpful to guide a meeting with a Registered Dietitian, who can help you with meal planning and other interventions.\r\n\r\n \r\n\r\nIn addition, abdominal surgeries can put survivors at risk for bowel obstructions (due to scarring), hernia (due to cutting the abdominal muscle) and changes in bowel patterns. Radiation therapy to the abdomen and pelvis can increase the risk of these complications.<br><br>\r\n\r\n \r\n\r\nSome general suggestions include:<ul>\r\n\r\n<li>Frequent, small meals (5 to 6 times daily) </li>\r\n\r\n<li>The diet should consist of mostly complex carbohydrates, which are whole plant foods such as fruits, vegetables, and whole grains. This should comprise 50 to 60% of the total daily calories.</li> \r\n\r\n<li>Include lean protein from sources such as the white meat of poultry, fish, and lean meats. </li>\r\n\r\n<li>No more than 20 to 30% of the diet should be fat. The healthiest types of fat are from plant sources such as olive oil & canola oil. </li>\r\n\r\n<li>Include 5-7 servings of fruits and vegetables per day. Canned fruit and cooked vegetable such as green beans, beets, and carrots can be eaten if fresh fruit and vegetables are not tolerated. </li>\r\n\r\n<li>Simple carbohydrates/sugars should be minimized. Examples of simple sugars are fruit juices or beverages and food items with sugar or high fructose corn syrup listed as one of the first 3-4 ingredients </li>\r\n\r\n<li>Foods should be well-chewed </li>\r\n\r\n<li>Fiber and vitamin supplementation may be indicated</li>\r\n\r\n</ul>','en',1,'2015-06-01 17:52:47',NULL,NULL,'b6c58e26-b63e-45dd-a6f0-81f8ea3cbda6'),(17449,162921,'Fortunately, we have 5 to 6 feet of large bowel, so if a section is removed, the remaining bowel can often perform the necessary tasks to regain normal bowel function. This is not always the case and survivors are at risk for bowel obstructions, hernia (due to cutting the abdominal muscle for surgery) and changes in bowel patterns. Radiation therapy to the abdomen and treatment with chemotherapy agents that cause motility issues (vincristine, vinorelbine, or vinblastine) can increase the risk of complications. <br><br>\r\n\r\nMany survivors report needing to move their bowels frequently and/or urgently, having loose bowels, gas / bloating and being intolerant of certain foods. These problems can have a big affect on quality of life, but some planning may help. Start by keeping a food diary. Record what and when you eat, what side effects you experience, and when they occur in relation to meals. This may give you a clear idea of what foods you need to avoid, but can be very helpful to guide a meeting with a Registered Dietician, who can help you with meal planning and other interventions.<br><br>\r\n\r\n In addition, abdominal surgeries can put survivors at risk for bowel obstructions (due to scarring), hernia (due to cutting the abdominal muscle) and changes in bowel patterns. Radiation therapy to the abdomen and pelvis can increase the risk of these complications.<br><br>\r\n\r\n \r\n\r\nSome general suggestions include:<br><br>\r\n\r\n<ul>\r\n\r\n<li>Frequent, small meals (5 to 6 times daily) </li>\r\n\r\n<li>The diet should consist of mostly complex carbohydrates, which are whole plant foods such as fruits, vegetables, and whole grains. </li>\r\n\r\n<li>This should comprise 50 to 60% of the total daily calories. </li>\r\n\r\n<li>Include lean protein from sources such as the white meat of poultry, fish, and lean meats. </li>\r\n\r\n<li>No more than 20 to 30% of the diet should be fat. The healthiest types of fat are from plant sources such as olive oil & canola oil. </li>\r\n\r\n<li>Include 5-7 servings of fruits and vegetables per day. Canned fruit and cooked vegetable such as green beans, beets, and carrots can be eaten if fresh fruit and vegetables are not tolerated. </li>\r\n\r\n<li>Simple carbohydrates/sugars should be minimized. Examples of simple sugars are fruit juices and beverages and food items with sugar or high fructose corn syrup listed as one of the first 3-4 ingredients </li>\r\n\r\n<li>Foods should be well-chewed </li>\r\n\r\n<li>Fiber and vitamin supplementation may be indicated </li>\r\n\r\n</ul>','en',1,'2015-06-01 17:53:42',NULL,NULL,'b812999e-6f26-4953-8b8a-57898cd7a49f'),(17450,162922,'Surgical procedures vary, so be sure to clarify which organs were removed. Removal of the ovaries causes a woman to go into menopause (if she is not already menopausal), leading to side effects including hot flashes, irritability, vaginal dryness and decreased sexual desire. This early lack of estrogen increases the risk of a woman developing osteoporosis (weakening of the bones) and heart disease. Removal of the ovaries also results in infertility. While less so, there is also risk of infertility when only one ovary is removed, particularly if combined with radiation to the abdomen or chemotherapy. A consult with a reproductive endocrinologist with experience in working with cancer survivors is warranted if the woman wishes to explore fertility options. <br><br>\r\n\r\nWomen who have had their cervix removed during hysterectomy should continue to have pap tests and pelvic exams, as this test can also detect vaginal tissue abnormalities.','en',1,'2015-06-01 17:54:31',NULL,NULL,'b75b1ddd-7cc0-4173-9f87-43eb84e9e463'),(17451,162923,'Removal of the bladder necessitates the formation of a \"pouch\" or reservoir to collect urine that may or may not be connected to a urostomy. This alteration in the natural anatomy and the possible need for chronic catheterization can lead to frequent or chronic urinary tract infections, reflux of urine into the kidneys (which can also cause infection), kidney dysfunction and hydronephrosis (swelling of the kidney). Survivors who have undergone cystectomy with any type of bladder reconstruction should be followed by an urologist for life.<br><br>\r\n\r\nSome surgical procedures create a â€œcontinent diversionâ€, which uses a piece of the bowel to produce a â€œbladderâ€ that is connected internally or to an ostomy. These include the Indiana and Kock pouch and orthotopic neobladder. Any reconstruction that utilizes a portion of the bowel can cause some long term problems related to the urine coming into contact with bowel tissue and/or the loss of some functioning bowel, including a loss of bone density or osteoporosis, vitamin B12 deficiency, kidney stones and metabolic acidosis (a condition which makes the body too acidic and is managed with alkaline medications). The portion of bowel continues to produce mucus, which can interfere with draining of the bladder.  In addition, this mucus can cause a positive pregnancy test (in men or women!); so female survivors should not rely on urine pregnancy tests. There is a risk of developing colon polyps or cancer in the portion of bowel used and this risk is known to be higher than the risk of colon tumors in the general population. There are no clear recommendations on screening for these polyps or tumors, which are thought to develop 5 or more years after the surgery. <br><br>\r\n\r\nAnother factor predictive of long term problems is the part of the bowel used to create the urinary diversion. The removal of the end of the small bowel (ileum) and the valve between the small and large bowels (ileocecal valve), which is used to create a continent â€œbladderâ€, results in some chronic bowel issues. These include poor digestion of fats, decreased vitamin absorption, gall and kidney stones and bowel changes, including frequent, looser stools and incontinence. It is important for an urologist knowledgeable in these procedures and their potential complications to follow survivors with continent diversions for life. <br><br>\r\n\r\nSome bladder cancer survivors will have undergone surgery where an ileal conduit was formed and urine now drains from a stoma/ostomy made from a part of intestine that was brought through an opening on the abdomen. The urine drains constantly from the stoma into an external pouch or bag. It is important to learn proper care for the stoma and surrounding skin to prevent complications and skin breakdown. Observe the stoma for changes in color and any swelling and report these changes to your healthcare provider immediately. Sexual concerns and concerns over changes in physical appearance arise for many survivors and usually improve with time as one becomes more accepting of the urine pouch. There are pouch covers available to help cover the pouch during intimate moments or one may use some type of cloth or sash. Choosing sexual positions that are comfortable and have minimal pressure on the bag is also encouraged to prevent any problems or leakage and help one feel more relaxed during intimate moments. <br><br>\r\n\r\nMany cystectomy procedures result in sexuality issues. In men, nerve damage can lead to erectile dysfunction and in women, the resection may include all or part of the vagina, resulting in a smaller vagina or no vagina. We will briefly address these issues, which survivors dealing with these complications should discuss with their healthcare team. In men who experience erectile dysfunction (ED), it can take several months to several years to regain function, if at all. Early intervention with medications is important to prevent muscle wasting (the penis is a muscle) and improve the chances of recovery of function. In cases where erectile function does not return, survivors should discuss other options available to allow them to return to as normal a sexual life as possible. Learn more about ED treatment options at the Us Too Prostate Cancer Education & Support website. Most urologists can manage this aspect of care. Some types of bladder surgeries may also remove the prostate gland. In these survivors, semen will no longer be produced so orgasm will be â€œdry.â€ <br><br>\r\n\r\nIf all or most of the vagina must be removed, it may be possible to rebuild (reconstruct) a vagina with tissue from another part of the body, allowing the woman to have intercourse. The new vagina will produce little or no natural lubricant when a woman becomes sexually excited. Therefore, these survivors should prepare for intercourse by using a lubricating gel inside the vagina. Initially, the woman may feel strange sensations when the vagina is touched or â€œstimulatedâ€ because it was created from tissue taken from another part of the body. These feelings will become less distracting over time. Emotional and psychological support is critical and survivors should consider joining support groups (in person or online) and psychological counseling support. <br><br>\r\n\r\nIn addition, abdominal surgeries can put survivors at risk for bowel obstructions (due to scarring), hernia (due to cutting the abdominal muscle) and changes in bowel patterns. Radiation therapy to the abdomen and pelvis can increase the risk of these complications. <br><br>\r\n\r\nSummary:<ul>\r\n\r\n<li>Survivors who have undergone cystectomy with any type of bladder reconstruction or with continent diversions should be followed for life by an urologist knowledgeable in these procedures and their potential complications.</li>\r\n\r\n<li>Many cystectomy procedures result in sexuality issues for both men and women. Survivors should talk to their healthcare team and consider support groups to help find ways to overcome these issues. </li>\r\n\r\n</ul>','en',1,'2015-06-01 17:55:14',NULL,NULL,'cd17da29-1075-4539-83bd-512b67f0d991'),(17452,162924,'Long term effects of radiation therapy vary greatly depending on the areas included in the field of radiation and the radiation techniques that were used, as these continue to develop and improve. One issue that is consistent across all tissues is the possibility of developing a second cancer in or near the radiation field. Secondary cancers develop as a result of the exposure of healthy tissue to radiation. Newer radiation techniques are designed to limit this exposure, but it is not always possible to prevent all exposure and still achieve the desired outcomes.','en',1,'2015-06-01 17:55:46',NULL,NULL,'8c44eca9-e6fa-4704-a80e-13b32f71282a'),(17453,162925,'Radiation can lead to changes in the skin. This can include changes in the color or texture of the skin, scars, and changes in the color or texture of hair, or permanent hair loss in the treated area. Some patients develop ulcers of the skin in the area treated with radiation and should be seen by a wound care specialist.   After radiation, the skin is more sensitive to sunlight, and survivors should be especially cautious to use sunscreen, wear protective clothing and avoid tanning booths.','en',1,'2015-06-01 17:56:11',NULL,NULL,'310e47c9-4219-4ec6-901d-cdf55a352eac'),(17454,162926,'Radiation may injure the gut that mayresult in side effects: <br><br>\r\n\r\nBleeding (ulceration) can be due to radiation causing inflammation to the bowel, called radiation colitis (colon) or radiation proctitis (rectum).  This problem may not appear until up to a year after radiation treatment, or longer.  Bright red blood in the stools, or dark black stools, should be reported immediately to a physician. <br><br>\r\n\r\nDiarrhea (malabsorption) can also result from inflammation of the bowel.  Anti-diarrheal medicines may be helpful.  Diarrhea accompanied by weight loss should be evaluated by a physician. Input from a dietician may also be useful for survivors who have lost weight.','en',1,'2015-06-01 17:56:43',NULL,NULL,'331aa9ec-87e4-4816-848e-537a1d80e63f'),(17455,162927,'Late effects to the bladder can include scarring, leading to a decrease in the bladder capacity. If given in conjunction with chemotherapy agents known to cause bladder damage (cyclophosphamide, ifosfamide), late effects can include hemorrhagic cystitis, a condition characterized by bleeding from the bladder lining. Symptoms of hemorrhagic cystitis include urinary frequency and urgency, blood in the urine and pain. Survivors at risk should report these symptoms to their healthcare provider right away. Persistent bleeding should be evaluated with cystoscopy. <br><br>\r\n\r\nRadiation to the bladder may also cause the survivor to be more susceptible to urinary tract infection. This type of infection can be treated with antibiotics given by mouth. Any symptoms of urinary burning, frequency, or blood in the urine should be reported immediately. <br><br>\r\n\r\nIn addition, radiation to the bladder can increase the risk of developing bladder cancer. Symptoms may include blood in the urine, urinary frequency and urgency, urinating at night and incontinence. Any of these symptoms should be discussed with a physician. Survivors should also avoid alcohol use and smoking as these may increase risk of bladder cancer. <br><br>\r\n\r\n<ul>\r\n\r\n<li>Urinalysis for any urinary symptoms, and treatment with antibiotics if infection is shown. </li>\r\n\r\n<li>Cystoscopy (small camera to evaluate bladder) for persistent bladder pain/ bleeding. </li>\r\n\r\n<li>Immediate evaluation of any bladder/ urinary symptoms with awareness that survivor may be at increased risk of bladder cancer. </li>\r\n\r\n<li>Avoidance of alcohol and smoking.</li>\r\n\r\n</ul>','en',1,'2015-06-01 17:57:20',NULL,NULL,'eb1ffc8f-1d65-49d6-b6c8-915d7320d8e3'),(17456,162928,'Radiation to the pelvis in a male patient may cause erectile dysfunction. This risk is highest in men who have erectile dysfunction before beginning radiation therapy. Remaining sexually active during radiation treatment may be helpful in preventing or minimizing erectile dysfunction. This symptom may be very distressing, and the survivor should discuss it with his physician. Medicine such as saldenafil (Viagra) may be useful. If these medicines are not helpful, the survivor should be seen by a Urologist. The MUSE system may assist men in having erections. Men may also consider penile implants or pumps. <br><br>\r\n\r\nRadiation to the groin area may cause damage to the lymph nodes, which can cause the genital area and legs to be permanently swollen. In these cases, physical therapy may be helpful. <br><br>\r\n\r\n<ul>\r\n\r\n<li>Yearly sexual history by a professional </li>\r\n\r\n<li>Medications for sexual dysfunction if survivor feels these would be helpful. </li>\r\n\r\n<li>Referral to a Urologist if medicines are not helpful for discussion of implants or pump systems. </li>\r\n\r\n<li>Physical therapy for genital or groin swelling.</li>\r\n\r\n</ul>','en',1,'2015-06-01 17:58:06',NULL,NULL,'2d825ab5-ca1b-46f4-9f6d-b9efb5e6f8fc'),(17457,162929,'Radiation to a woman\'s pelvis can cause long term changes to the vagina and uterus. Survivors may suffer from vaginal dryness, shrinkage, atrophy (decrease in size), pain, bleeding and painful intercourse. Use of personal lubricants can be helpful and allow more comfortable intercourse, and regular use of vitamin E may help to strengthen tissues and reduce friction to sensitive tissues. Scarring in the vaginal vault may cause the size of the vagina to decrease. Use of vaginal dilators which are placed in the vagina for short periods of time is recommended for all female survivors who have had radiation to the pelvic area. Lastly, medicines such as amitriptyline (tricyclic antidepressants) may be useful for vulvar pain syndromes. <br><br>\r\n\r\nRadiation to the groin area may cause damage to the lymph nodes, which can cause the genital area and legs to be permanently swollen. In these cases, physical therapy may be helpful. <br><br>\r\n\r\nRadiation to the uterus (womb) can lead to decrease in uterine size as well as decrease in elasticity (stretch) and scarring. These changes in the uterine muscle can cause survivors to be at increased risk of miscarriage, preterm labor and low birth weight infants. Survivors who wish to become pregnant should be followed by a high risk pregnancy specialist. <br><br>\r\n\r\nRadiation fields that include the ovaries can result in damage to a woman\'s supply of eggs (oocytes). The risk of sterility is increased with higher doses of radiation. Older women are also at increased risk of infertility from radiation, although fertility after radiation is an individual outcome, and is quite difficult to predict. For most women, menses will stop during treatment, but are likely to return in younger women (<40). Those women who do regain menses are still at risk for premature menopause. <br><br>\r\n\r\n<ul>\r\n\r\n<li>Use of personal lubricants and/ or vitamin E if vaginal area is painful, dry, or tender during intercourse. </li>\r\n\r\n<li>Use of vaginal dilators for scarring causing decrease in size of vagina. </li>\r\n\r\n<li>Treatment of vulvar pain syndromes </li>\r\n\r\n<li>Physical therapy for swelling of genital or legs. </li>\r\n\r\n<li>Evaluation by high-risk pregnancy specialist for survivors who wish to become pregnant. </li>\r\n\r\n<li>Evaluation by an endocrinologist for hormonal abnormalities and/ or premature menopause. </li>\r\n\r\n</ul>','en',1,'2015-06-01 17:58:34',NULL,NULL,'b9f8aebc-2dc4-45c8-8595-23513f2e7d0d'),(17458,162930,'Colorectal (CRC) cancer survivors are encouraged to adopt a healthy lifestyle.  Maintaining a healthy weight typically includes regular exercise and eating a healthy diet, including lots of fruits and vegetables.  Other important steps include avoiding any tobacco use and using alcohol only in moderation.  In discussion with their physicians, CRC survivors should also follow recommended guidelines for cancer screening.<br/><br/>Many people find both help and friendship in a support group, whether it is in-person or on-line.<br/><br/>The following sections will address risks related to the treatments you received.','en',1,'2015-06-01 17:59:43',NULL,NULL,'33908b29-df77-436e-8a4b-b4ace1002d30'),(17459,162931,'The receipt of chemotherapy and radiation therapy to the pelvis may cause fertility issues after cancer treatment.  Female colorectal cancer survivorsâ€™ menstruation may restart after therapy, but this does not guarantee fertility.  Women who do restart menstruation after cancer therapy should be aware that they could still have early menopause, which may be a consideration when planning a family.  On the other hand, women should recognize that even if their menstruation stops during treatment, one may still be able to get pregnant if birth control is not used.<br><br>\r\n\r\nTesting may be done to help evaluate fertility, including certain hormone levels and other special tests.  Survivors who wish to become pregnant or evaluate their fertility should consider seeing a fertility or reproductive specialist.  The National Infertility Associationâ€™s website also offers information on fertility testing, treatments, and the decision to have children. <br><br>\r\n\r\nThe American Society of Clinical Oncology (ASCO) suggests that women with a history of cancer treatment should be considered high risk for potential complications during pregnancy, and should seek care from a high-risk obstetrician.','en',1,'2015-06-01 18:00:09',NULL,NULL,'692990ce-0825-4e54-b9b1-d2f323505234'),(17460,162932,'Testing may be done to help evaluate fertility, including certain hormone levels and sperm counts. Survivors who wish to father a child or assess their fertility should consider seeing a urologist or fertility specialist. The National Infertility Associationâ€™s website offers information on fertility testing, treatments, and the decision to have children.','en',1,'2015-06-01 18:00:41',NULL,NULL,'8800d97f-7393-419b-a4d2-836fcb24ef90'),(17461,162933,'Some survivors experience changes in bowel patterns.  If you find the change in bowel patterns affecting your quality of life, you should talk with your healthcare providers.\r\n\r\nMany survivors report needing to move their bowels more often or urgently.  Some report having loose stools, gas or bloating, and being intolerant of certain foods. Attention to your diet may help. Consider starting a food diary. Record what and when you eat, what side effects you experience, and when they occur in relation to meals.   A dietician may be helpful with meal planning and other interventions.  To facilitate a referral, try calling the American Dietetic Association\'s toll-free nutrition hotline or using their online resources.<br><br>\r\n\r\nSimple dietary steps may include:\r\n\r\n<ul>\r\n\r\n<li>\r\n\r\nFrequent, small meals (5 to 6 times daily)\r\n\r\n</li>\r\n\r\n<li>\r\n\r\nEat when you can, many people find their appetite is better in the morning.\r\n\r\n</li>\r\n\r\n<li>\r\n\r\nConsume adequate amounts of fruits and vegetables (5-7 servings per day) \r\n\r\n</li>\r\n\r\n<li>\r\n\r\nDrink plenty of fluids\r\n\r\n</li>\r\n\r\n<li>\r\n\r\nEat whole grains, fiber supplementation may be indicated\r\n\r\n</li>\r\n\r\n</ul>\r\n\r\nMore serious bowel problems can occur after surgery, especially after receiving radiation treatment:\r\n\r\n<ul>\r\n\r\n<li>Bowel obstruction occurs when parts of the bowel stick together and do not allow the passage of its contents.  Obstruction is a medical emergency.  You should seek immediate medical evaluation for severe abdominal pain, especially if accompanied by nausea, vomiting, or constipation.</li>\r\n\r\n<li>Fistulas may form when two body cavities connect, such as the bowel and bladder, bowel and vagina, or bowel and skin.  Any abnormal passage of urine feces, or blood should be immediately reported to a physician.</li>\r\n\r\n</ul>','en',1,'2015-06-01 18:01:22',NULL,NULL,'238a238f-267e-4613-b162-e3a9e853cb30'),(17462,162934,'The removal of lymph nodes from the abdomen or groin area can lead to decreased drainage in the legs, causing lymphedema, or swelling of the limb.  Signs of lymphedema near the area of surgery (leg, abdomen, genitals) may include skin changes (reddened, warm, hard, stiff) or pain. You may also experience difficulty fitting into clothes or pants.  Lymphedema can occur months, or even years after treatment. If swelling develops, early recognition may allow for better outcomes. <br><br>\r\n\r\nColorectal cancer survivors should notify their healthcare providers with any signs of swelling to determine if this may be caused by lymphedema, versus another medical problem (heart failure, blood clots).  A certified lymphedema therapist may be consulted.','en',1,'2015-06-01 18:01:57',NULL,NULL,'3bfd9394-7a7b-4329-9a71-7f204a70a3e4'),(17463,162935,'During surgery, some patients undergo a diversion of the bowel in the form of a temporary or permanent ostomy.  An ostomy has many possible effects on daily life, including wearing an ostomy bag underneath oneâ€™s clothing, possible skin irritation, challenges with diet selection and bowel control.  Social, emotional, or sexual issues may also arise.  Colorectal cancer survivors with an ostomy are advised to empty and seal their pouch before engaging in sexual activity.   At some point, survivors with an ostomy should see an ostomy nurse, who can provide help and education in caring for the ostomy and its associated appliances.','en',1,'2015-06-01 18:02:28',NULL,NULL,'72780620-24d6-47f4-b429-58aa594f5a14'),(17464,162936,'We fortunately have 5 to 6 feet of large bowel, so if a section is removed, the remaining bowel can still function normally.  Yet some survivors do experience changes in bowel patterns.  If you find the change in bowel patterns affecting your quality of life, you should talk with your healthcare providers.<br><br>\r\n\r\nMany survivors report needing to move their bowels more often or urgently.  Some report having loose stools, gas or bloating, and being intolerant of certain foods. Attention to your diet may help. Consider starting a food diary. Record what and when you eat, what side effects you experience, and when they occur in relation to meals.   A dietician may be helpful with meal planning and other interventions.  To facilitate a referral, try calling the American Dietetic Association\'s toll-free nutrition hotline or using their online resources.<br><br>\r\n\r\nSimple dietary steps may include:<br>\r\n\r\n<ul>\r\n\r\n<li>Frequent, small meals (5 to 6 times daily)</li>\r\n\r\n<li>Eat when you can, many people find their appetite is better in the morning.</li>\r\n\r\n<li>Consume adequate amounts of fruits and vegetables (5-7 servings per day)</li>\r\n\r\n<li>Drink plenty of fluids</li>\r\n\r\n<li>Eat whole grains, fiber supplementation may be indicated</li>\r\n\r\n</ul>\r\n\r\nMore serious bowel problems can occur after surgery, especially after receiving radiation treatment:<br>\r\n\r\n<ul>\r\n\r\n<li>Bowel obstruction occurs when parts of the bowel stick together and do not allow the passage of its contents.  Obstruction is a medical emergency.  You should seek immediate medical evaluation for severe abdominal pain, especially if accompanied by nausea, vomiting, or constipation.</li>\r\n\r\n<li>Fistulas may form when two body cavities connect, such as the bowel and bladder, bowel and vagina, or bowel and skin.  Any abnormal passage of urine feces, or blood should be immediately reported to a physician.</li>\r\n\r\n</ul>','en',1,'2015-06-01 18:02:58',NULL,NULL,'1c247fda-fccf-4a8f-a55a-fba05b7d7593'),(17465,162937,'Generic answer to a question.','en',1,'2015-06-01 18:03:56',NULL,NULL,'5e4676ae-115a-4775-b80e-84b00e820d36'),(17585,163139,'A member of a group fourth in order or rank','en',1,'2015-12-13 15:00:18',1,'2015-12-13 15:02:03','17585FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(18157,1067,'کسی سوال کا عام جواب','ur',1,'2016-08-16 07:46:41',1,NULL,'18157FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(18158,1065,'کسی سوال کا عام جواب','ur',1,'2016-08-16 07:47:47',1,NULL,'18158FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(18159,1066,'کسی سوال کا عام جواب','ur',1,'2016-08-16 07:48:25',1,NULL,'18159FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF');
