e modules that were running  prior to a restart are started again','11b82649-8ea2-4e38-b455-697dd36cacf3',NULL,NULL,NULL,NULL,NULL,NULL),('simpleformservice.mandatory','false','true/false whether or not the simpleformservice module MUST start when openmrs starts.  This is used to make sure that mission critical modules are always running if openmrs is running.','fafe3f97-9698-49d0-8313-5a8ac2e05be6',NULL,NULL,NULL,NULL,NULL,NULL),('simpleformservice.started','true','DO NOT MODIFY. true/false whether or not the simpleformservice module has been started.  This is used to make sure modules that were running  prior to a restart are started again','70a8607f-baca-49ff-82bd-eb2b3637967f',NULL,NULL,NULL,NULL,NULL,NULL),('uicommons.mandatory','false','true/false whether or not the uicommons module MUST start when openmrs starts.  This is used to make sure that mission critical modules are always running if openmrs is running.','971864b2-fd61-4fc1-8a2b-e1b79ea3b144',NULL,NULL,NULL,NULL,NULL,NULL),('uicommons.started','true','DO NOT MODIFY. true/false whether or not the uicommons module has been started.  This is used to make sure modules that were running  prior to a restart are started again','8cd3885b-cf06-4ce4-b854-98647d5e18eb',NULL,NULL,NULL,NULL,NULL,NULL),('uiframework.formatter.dateAndTimeFormat','dd.MMM.yyyy, HH:mm:ss','Format used by UiUtils.format for dates that have a time component','e851064d-e2c7-427a-b782-4ffa2fa735a3',NULL,NULL,NULL,NULL,NULL,NULL),('uiframework.formatter.dateFormat','dd.MMM.yyyy','Format used by UiUtils.format for dates that do not have a time component','98a4bb62-991e-4c84-b746-adb7be76dd07',NULL,NULL,NULL,NULL,NULL,NULL),('uiframework.mandatory','false','true/false whether or not the uiframework module MUST start when openmrs starts.  This is used to make sure that mission critical modules are always running if openmrs is running.','79677af6-04c7-4490-9cc3-75ac094fa829',NULL,NULL,NULL,NULL,NULL,NULL),('uiframework.started','true','DO NOT MODIFY. true/false whether or not the uiframework module has been started.  This is used to make sure modules that were running  prior to a restart are started again','d48e3cb1-e4b5-48a2-bd3c-74263c89566b',NULL,NULL,NULL,NULL,NULL,NULL),('uilibrary.mandatory','false','true/false whether or not the uilibrary module MUST start when openmrs starts.  This is used to make sure that mission critical modules are always running if openmrs is running.','9b2bcbaa-7ce4-4c99-ac17-90b1a92ac7dd',NULL,NULL,NULL,NULL,NULL,NULL),('uilibrary.started','true','DO NOT MODIFY. true/false whether or not the uilibrary module has been started.  This is used to make sure modules that were running  prior to a restart are started again','f0d1197d-3d37-457c-a081-dae512893d87',NULL,NULL,NULL,NULL,NULL,NULL),('user.headerAttributeTypes','','A comma delimited list of PersonAttributeType names that will be shown on the user dashboard. (not used in v1.5)','a7af4f9a-0cf6-418f-bada-3ecd0dfd4004',NULL,NULL,NULL,NULL,NULL,NULL),('user.listingAttributeTypes','','A comma delimited list of PersonAttributeType names that should be displayed for users in _lists_','dab66414-7955-4d7c-911d-a37eec6505c3',NULL,NULL,NULL,NULL,NULL,NULL),('user.requireEmailAsUsername','false','Indicates whether a username must be a valid e-mail or not.','24e8b627-f1a2-4e91-869d-6f13ee965c02','org.openmrs.customdatatype.datatype.BooleanDatatype',NULL,NULL,NULL,NULL,NULL),('user.viewingAttributeTypes','','A comma delimited list of PersonAttributeType names that should be displayed for users when _viewing individually_','46d2ccd4-4c0c-486b-b567-8b0a68174a9d',NULL,NULL,NULL,NULL,NULL,NULL),('use_patient_attribute.healthCenter','false','Indicates whether or not the \'health center\' attribute is shown when viewing/searching for patients','21d9b50b-66fd-4276-aba5-aac75a9bff78','org.openmrs.customdatatype.datatype.BooleanDatatype',NULL,NULL,NULL,NULL,NULL),('use_patient_attribute.mothersName','false','Indicates whether or not mother\'s name is able to be added/viewed for a patient','9515b6a4-9df4-4deb-ab81-d376c1cf1b92','org.openmrs.customdatatype.datatype.BooleanDatatype',NULL,NULL,NULL,NULL,NULL),('validation.disable','false','Disables validation of OpenMRS Objects. Only takes affect on next restart. Warning: only do this is you know what you are doing!','1e8596ab-171a-432c-b2ae-b9c98066c353',NULL,NULL,NULL,NULL,NULL,NULL),('visits.allowOverlappingVisits','true','true/false whether or not to allow visits of a given patient to overlap','49ceb185-c7b7-457d-8e3e-7d9f133377a8','org.openmrs.customdatatype.datatype.BooleanDatatype',NULL,NULL,NULL,NULL,NULL),('visits.assignmentHandler','org.openmrs.module.emrapi.adt.EmrApiVisitAssignmentHandler','Set to the name of the class responsible for assigning encounters to visits.','2317b637-f760-4ec2-be35-30188214fe2f',NULL,NULL,NULL,NULL,NULL,NULL),('visits.autoCloseVisitType','','comma-separated list of the visit type(s) to automatically close','c64fa7e2-efb4-4522-9764-dddd82e72a8b',NULL,NULL,NULL,NULL,NULL,NULL),('visits.enabled','true','Set to true to enable the Visits feature. This will replace the \'Encounters\' tab with a \'Visits\' tab on the dashboard.','f2f2f3eb-ec8b-48c3-83b5-b1e080080ccc','org.openmrs.customdatatype.datatype.BooleanDatatype',NULL,NULL,NULL,NULL,NULL),('visits.encounterTypeToVisitTypeMapping','','Specifies how encounter types are mapped to visit types when automatically assigning encounters to visits. e.g 1:1, 2:1, 3:2 in the format encounterTypeId:visitTypeId or encounterTypeUuid:visitTypeUuid or a combination of encounter/visit type uuids and ids e.g 1:759799ab-c9a5-435e-b671-77773ada74e4','d85c84c4-d4f2-4161-b60a-7a7e6f489c45',NULL,NULL,NULL,NULL,NULL,NULL),('webservices.rest.allowedips','','A comma-separate list of IP addresses that are allowed to access the web services. An empty string allows everyone to access all ws. \r\n        IPs can be declared with bit masks e.g. 10.0.0.0/30 matches 10.0.0.0 - 10.0.0.3 and 10.0.0.0/24 matches 10.0.0.0 - 10.0.0.255.','ee00e974-748d-43fa-be61-4af91b946cca',NULL,NULL,NULL,NULL,NULL,NULL),('webservices.rest.mandatory','false','true/false whether or not the webservices.rest module MUST start when openmrs starts.  This is used to make sure that mission critical modules are always running if openmrs is running.','586239c9-02bd-4c77-a59f-bc8ba5a4f241',NULL,NULL,NULL,NULL,NULL,NULL),('webservices.rest.maxResultsAbsolute','100','The absolute max results limit. If the client requests a larger number of results, then will get an error','4d3b3961-16b7-4486-a0e3-24907336fd2c',NULL,NULL,NULL,NULL,NULL,NULL),('webservices.rest.maxResultsDefault','50','The default max results limit if the user does not provide a maximum when making the web service call.','331fbfb9-bbe5-4f38-ac19-e1ddc8e3c128',NULL,NULL,NULL,NULL,NULL,NULL),('webservices.rest.quietDocs','true','If the value of this setting is \"true\", then nothing is logged while the Swagger specification is being generated.','8d1dcb19-c173-43a8-9b18-908bb05c10cd',NULL,NULL,NULL,NULL,NULL,NULL),('webservices.rest.started','true','DO NOT MODIFY. true/false whether or not the webservices.rest module has been started.  This is used to make sure modules that were running  prior to a restart are started again','59000b93-fded-4055-91d5-085fdd4419ca',NULL,NULL,NULL,NULL,NULL,NULL),('webservices.rest.uriPrefix','','The URI prefix through which clients consuming web services will connect to the web application, should be of the form http://{ipAddress}:{port}/{contextPath}','a0db6c1d-c610-4ea1-84e3-527fd2882713',NULL,NULL,NULL,NULL,NULL,NULL);
