INSERT INTO `patientportal_journal_entry` VALUES (1,'92156225-3410-48f8-bad0-886c9a18cc9d','test1','I feel tired this morning',7,'2011-05-10 22:31:27',0,NULL,NULL),(2,'10230ebe-db85-47b7-9783-5994e0e16743','test2','I had an appointment with my doctor today. Feel <STRONG>much better</STRONG> now!<br><br>Hui',8,'2011-05-10 22:32:29',0,NULL,NULL),(3,'d055df09-6b6a-44e0-8005-ca5d4c6a508c','Test3','<br>Created by doctor smith!<br><br>Dr. Smith',8,'2011-05-10 22:38:49',0,NULL,NULL),(5,'ed0765ea-f21b-4c64-947f-8c855ca6f332','Welcome to your journal','<strong style=\"font-size: 14px;\">Welcome to Your Journal<br></strong><br>You are seeing this message because you are either a new user or have not yet written a journal entry.&nbsp; Please consider this space as:<br><br>â¢ A place for your thoughts and experiences while living with colorectal cancer<br><br>â¢ A place which could help others realize how far you\'ve come, as well as see and understand your experiences with cancer<br><br>â¢ A record of your experiences for you and others to look back upon<br><br>Once you start writing in this journal, this entry will disappear.&nbsp; If you have any questions, contact the system administrator at: <span style=\"text-decoration: underline;\">sysadmin@crc.com</span><br>',8,'2011-05-18 09:39:54',0,NULL,NULL),(6,'858802a3-b9a5-4538-8cc3-d4ccb314105b','I feel happy!','Happy, happy, happy!&nbsp; Joy, joy, joy!',1,'2011-05-23 11:46:14',0,NULL,NULL),(7,'a1e25523-8e1e-4cbb-8fcc-839848773d38','My Journal','Testing to see what happens if I put something like &lt;a href=\"http://google.com\"&gt;Google&lt;/a&gt; into my post.',8,'2011-05-23 11:47:57',0,NULL,NULL),(8,'0ab0d8c7-dfc2-4430-9272-f3875349aca1','Coolness!','Time to make a quick entry!',8,'2011-05-25 09:08:57',0,NULL,NULL),(9,'64f7c950-e5af-4309-b5b2-65773f7a1331','Add an entry to test delete','Here is an entry to be deleted.<br><br>Hui',4,'2011-05-27 16:16:10',0,NULL,NULL),(10,'00f461c8-7541-4719-8ecb-dee1ce8ede07','My Cancer experience.','Living with cancer is a lonely life, not knowing if you will live a month, a year or die in a week. Cancer is a silent killer, not following up on symptoms can result in death. Cancer comes without being invited. I had cancer and I never smoked or drank. More people need to listen to their body and get tested for early signs of cancer like I did and we can beat this killer of young and old.',8,'2011-06-01 12:03:15',0,NULL,NULL),(11,'182cc79f-24ec-48ac-8dc9-a030ff290c64','My cancer','I have met many new friends because of my cancer. I feel I am getting the best treatment and care anyone could ask for.',8,'2011-06-06 10:33:50',0,NULL,NULL),(12,'392501d0-23e5-4e33-b865-f2fce7f956d9','joker','Lets put a smile on that face',1,'2015-05-26 22:58:01',0,NULL,1),(13,'e49341fe-33bc-4376-a6ae-0c1babd99260','New UI','i\'m Excited about the new UI',8,'2015-06-19 16:10:16',0,NULL,NULL),(14,'a94fcfca-eeee-4647-8fe3-c702667becb0','My new Journal','Hello How are you',8,'2015-06-19 19:42:36',0,NULL,NULL),(15,'5bcc2d54-cbd4-4684-8fce-135a08546a8e','JohnoooRambo','i\'m good',8,'2015-06-22 11:42:00',0,NULL,14),(16,'dff61773-0aa5-4946-86f5-2ca22ae60ece','JohnoooRambo','i\'m very good',8,'2015-06-22 11:45:19',0,NULL,14),(17,'e5423cf8-2a6c-4985-9c06-f3c98f4df57a','Johnooo Rambo','i\'m not feeling very good',8,'2015-06-22 13:50:39',0,NULL,14),(18,'c3559538-bddf-453a-aa61-60b2022388b4','22nd june journal','sun is bright',8,'2015-06-22 14:05:07',0,NULL,NULL),(19,'2914ef00-f32d-4622-9944-4aeded310c54','Johnooo Rambo','aaa',8,'2015-06-22 14:06:08',0,NULL,14),(20,'89f5f932-5a36-41c3-85f7-e0ca1585ebab','Johnooo Rambo','bbbb',8,'2015-06-22 14:44:31',0,NULL,14),(21,'f456c673-aed9-4b6c-986e-3a8e4bf62644','Johnooo Rambo','sun is very bright',8,'2015-06-22 14:44:52',0,NULL,18),(22,'e4d38f55-704d-488a-9e3b-4cd9eae54b6b','Johnooo Rambo','sun is getting darker',8,'2015-06-22 14:45:05',0,NULL,18),(23,'18016741-6e6b-40ce-a5f1-9e96eb55c69a','Johnooo Rambo','jfjsfjefj',8,'2015-06-22 15:12:12',0,NU