INSERT INTO `patientportal_preferences` VALUES (1,7,1,'John','Colon cancer survivor who received chemotherapy about 3 years ago.  Still experience neuropathy.  Would like to share & learn from experience of others.','6253179c-4346-4bb2-91b3-639448324488'),(2,32,1,'Penny','I am a Stage II cancer patient in central Indiana, just starting chemotherapy.  Interested in getting recommendations for health care providers in this part of the country.','e08b270b-c0e8-43c0-bb77-33f1ed50b37f'),(3,42,0,'Harry Potter','Hi I\'m Harry','c87fdd41-6920-4f66-ae8f-19c4cce7bfb7'),(4,45,1,'Ronald','Hello I\'m Ronald. I am a rectal cancer survivor, I would like to connect with other patients like me and discuss how they are coping.','3f587fee-2257-4590-b34b-57e66ca6baad'),(5,46,0,'demo2','Hello I\'m demo2','f3facaf8-597d-436c-a996-0495c425bea8'),(6,47,0,'demo3','Hello I\'m demo3','2b7e3913-0d38-478b-8acf-5f2cc4a4f763'),(7,48,1,'Joe Public','Hello I have an ostomy and am interested in connecting with other patients who manage this.','222ab42f-c9e3-4f33-9a5d-09a4e4f6c421'),(9,49,0,'demo5patient','Hello, I would like to be a part of My Cancer Buddies','f68f6fc6-3e92-444c-8cce-f1f993ca0223');
